import React from "react";
import {useNavigate} from "react-router-dom";
import {useGlobalContext} from "../context";

const Home = () => {
    const { user } = useGlobalContext();
    const navigate = useNavigate();

    return (
        <>
            {user && navigate('/dashboard')}
        </>
    )
}
export default Home;
